import React, { useState } from "react";
import classes from "./ProjectOverviewBox.module.css";

const ProjectOverviewBox = (props) => {
  [classFirst, changeClass] = useState(false);

  const styleHandle = () => {
    changeClass(true);
  };

  return (
    <div className={classes.ProjectContainer}>
      <div
        onClick={styleHandle}
        className={classFirst ? classes.BigBox : classes.Box}
      ></div>

      <p className={classes.NameSelector}>small amount of info</p>

      <p className={classes.DateSelector}>Date Posted:{props.date}</p>
    </div>
  );
};

export default ProjectOverviewBox;
